<div class="entities" style="line-height: 2.5; direction: ltr">Synergistic proapoptotic effects of the two tyrosine kinase inhibitors pazopanib and lapatinib on multiple carcinoma cell lines .

 tyrosine kinase receptors 1 , 2 and 3 ( pazopanib ) , and the

 and

</mark>
 has also been reported to mediate inhibitory effect on a selected panel of additional tyrosine kinases such as 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 and c-kit . Here , we report that pazopanib and lapatinib act synergistically to induce apoptosis of A549 non-small-cell lung cancer cells . Systematic assessment of the kinome revealed that both pazopanib and lapatinib inhibited dozens of different tyrosine kinases and that their combination could suppress the activity of some tyrosine kinases ( such as c - DB00134 ) that were not or only partially affected by either of the two agents alone . We also found that pazopanib and lapatinib induced selective changes in the transcriptome of A549 cells , some of which were specific for the combination of both agents . Analysis of a panel of unrelated human carcinoma cell lines revealed a signature of 52 genes whose up - or downregulation reflected the combined action of pazopanib and lapatinib . Indeed , pazopanib and lapatinib exerted synergistic cytotoxic effects on several distinct non-small-cell lung cancer cells as well as on unrelated carcinomas . Altogether , these results support the contention that combinations of tyrosine kinase inhibitors should be evaluated for synergistic antitumor effects . Such combinations may lead to a ' collapse ' of pro-survival signal transduction pathways that leads to apoptotic cell death .</div>

<h2 style="margin: 0">8</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Comprehensive molecular characterization of urothelial bladder carcinoma . Urothelial carcinoma of the bladder is a common malignancy that causes approximately 150,000 deaths per year worldwide . So far , no molecularly targeted agents have been approved for treatment of the disease . As part of The Cancer Genome Atlas project , we report here an integrated analysis of 131 urothelial carcinomas to provide a comprehensive landscape of molecular alterations . There were statistically significant recurrent mutations in 32 genes , including multiple genes involved in cell-cycle regulation , chromatin regulation , and kinase signalling pathways , as well as 9 genes not previously reported as significantly mutated in any cancer . RNA sequencing revealed four expression subtypes , two of which ( papillary-like and basal / squamous-like ) were also evident in microRNA sequencing and protein data . Whole-genome and RNA sequencing identified recurrent in-frame activating

<h2 style="margin: 0">12</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">

 for the treatment of renal cancer . INTRODUCTION : Dramatic advances in the care of patients with advanced renal cell carcinoma ( RCC ) have occurred over the last 10 years . Insights into the molecular pathogenesis of this disease have elucidated the importance of signaling cascades related to angiogenesis in the management of RCC . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 is a novel , small-molecule tyrosine kinase inhibitor that targets vascular endothelial growth factor receptors ( VEGFR ) - 1 , - 2 , and - 3 ; platelet-derived growth factor receptors (

 ) - α and - β ; and c-kit tyrosine kinases . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06589

 exhibits distinct pharmacokinetic and toxicity profiles compared with other agents in the class of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 signaling pathway inhibitors . AREAS COVERED : This review discusses the scientific rationale for the development of pazopanib , as well as the preclinical and clinical trials that led to the approval of pazopanib for patients with advanced RCC . The most recent information , including data from the 2010 meeting of the American Society of Clinical Oncology and the design of ongoing Phase III trials , is discussed . Finally , an algorithm utilizing level I evidence for the treatment of patients with this disease is proposed . EXPERT OPINION : The treatment of metastatic RCC has changed dramatically over the last 5 years . Six novel agents - sunitinib , sorafenib , temsirolimus , everolimus , bevacizumab ( used in combination with interferon ) , and pazopanib ( Votrient ) - have been approved for the treatment of metastatic RCC . The clinical data to date clearly place pazopanib among the most active of the targeted therapies .</div>

<h2 style="margin: 0">14</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">The achilles heel of ErbB - 2 / 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04626
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 : regulation by the Hsp 90 chaperone machine and potential for pharmacological intervention . Signal transduction mediated by ErbB / HER receptor tyrosine kinases is crucial for the development and maintenance of epithelial tissues , and aberrant signaling is frequently associated with malignancies of epithelial origin . This review focuses on the roles played by the Hsp 90 chaperone machinery in the regulation of signaling through the ErbB / HER network , and discusses potential therapeutic strategies that disrupt chaperone functions . Hsp 90 and its associated cochaperones regulate ErbB signal transduction through multiple mechanisms . The chaperone system controls the stability of the nascent forms of both ErbB - 1 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01133

</mark>
 - receptor ) and ErbB - 2 / 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04626
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , while regulation of the mature form is restricted to ErbB - 2 . Regulation by the Hsp 90 complex extends to downstream effectors of ErbB signaling , namely 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04049
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , Pdk - 1 and Akt / 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P31749
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 . Disrupting the function of Hsp 90 results in the degradation of both the receptors and their effectors , thereby inhibiting tumor cell growth . The importance of an Hsp 90 - recognition motif located within the kinase domain of ErbB - 2 is discussed , as well as a direct role for Hsp 90 in regulating tyrosine kinase activity . In light of recent observations , we emphasize the ability of specific tyrosine kinase inhibitors to selectively target ErbB - 2 to the chaperone-mediated degradation pathway . ErbB-specific drugs are already used to treat cancers , and clinical trials are underway for additional compounds that intercept ErbB signaling , including drugs that target Hsp 90 . Hence , the dependence of ErbB - 2 upon Hsp 90 reveals an Achilles heel , which opens a window of opportunity for combating cancers driven by the ErbB / HER signaling network .</div>

 ( P62158 ) metabolism is reportedly enhanced by induction of hepatic drug-metabolizing enzymes (

<div class="entities" style="line-height: 2.5; direction: ltr">Functional methionine synthase deficiency ( cblE and cblG ) : clinical and biochemical heterogeneity . Functional methionine synthase deficiency is generally characterized by homocystinuria and hypomethioninemia in the absence of methylmalonic aciduria . Patients are divided into two classes , cblE and cblG , on the basis of complementation analysis . Presentation has usually been in the first 2 years of life , but one patient came to medical attention at age 21 years with symptoms initially diagnosed as multiple sclerosis . Common findings among 11 patients ( 4 with cblE and 7 with cblG ) have included megaloblastic anemia ( all patients ) and various neurological deficits including developmental retardation ( 10 patients ) , cerebral atrophy ( 8 patients ) , hypotonia ( 7 patients ) , EEG abnormalities ( 6 patients ) , and nystagmus ( 5 patients ) . Hypertonia , seizures , blindness , and ataxia were less frequent . All patients have responded to therapy with cobalamin with resolution of anemia and biochemical abnormalities ; neurological deficits resolved more slowly and in some cases incompletely . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00200
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 has been more effective than cyanocobalamin . Fibroblasts from patients with cblE ( 5 patients ) and cblG ( 6 patients ) all showed decreased intracellular levels of methylcobalamin ( DB03614 ) and decreased incorporation of label from 5 - methyltetrahydrofolate into macromolecules , suggesting decreased activity of the DB03614 - dependent enzyme methionine synthase . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q99707
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 specific activity in extracts of all cblE fibroblasts was normal or near-normal under standard reducing conditions ; synthase specific activity in extracts of 5 cblG patients was low but was high in a 6th patient measured in another laboratory . Thus , there is heterogeneity among patients with functional methionine synthase deficiency both in clinical presentation and in the results of biochemical studies of cultured cells .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Rheb protein binds CAD ( carbamoyl-phosphate synthetase 2 , aspartate transcarbamoylase , and dihydroorotase ) protein in a GTP - and effector domain-dependent manner and influences its cellular localization and carbamoyl-phosphate synthetase ( CPSase ) activity . Rheb small GTPases , which consist of Rheb 1 and Q8TAI7 ( also known as RhebL 1 ) in mammalian cells , are unique members of the Ras superfamily and play central roles in regulating protein synthesis and cell growth by activating 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42345
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 . To gain further insight into the function of Rheb , we carried out a search for Rheb-binding proteins and found that Rheb binds to 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P27708
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( carbamoyl-phosphate synthetase 2 , aspartate transcarbamoylase , and dihydroorotase ) , a multifunctional enzyme required for the de novo synthesis of pyrimidine nucleotides . CAD binding is more pronounced with Q8TAI7 than with Rheb 1 . Rheb binds CAD in a GTP - and effector domain-dependent manner . The region of CAD where Rheb binds is located at the C-terminal region of the carbamoyl-phosphate synthetase domain and not in the dihydroorotase and aspartate transcarbamoylase domains . Rheb stimulated carbamoyl-phosphate synthetase activity of CAD in vitro . In addition , an elevated level of intracellular UTP pyrimidine nucleotide was observed in Tsc 2 - deficient cells , which was attenuated by knocking down of Rheb . Immunostaining analysis showed that expression of Rheb leads to increased accumulation of CAD on lysosomes . Both a farnesyltransferase inhibitor that blocks membrane association of Rheb and knockdown of Rheb mislocalized CAD . These results establish CAD as a downstream effector of Rheb and suggest a possible role of Rheb in regulating de novo pyrimidine nucleotide synthesis .</div>
